webpackJsonp([0xc1360f275407],{568:function(e,a){e.exports={pathContext:{frontmatter:{path:"/contributing/opening-a-pull-request",title:"Opening a Pull Request",hasPlayground:!1,initialPlayground:null,redirect:null},html:'<h1>Opening a Pull Request</h1>\n<p>Before opening your first pull request to Yoga you have to know how to get the code,\ninstall build time dependencies, and test the code locally.</p>\n<h3>Clone</h3>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">$&gt; git clone https://github.com/facebook/yoga.git\n$&gt; cd yoga</code></pre>\n      </div>\n<h3>Install dependencies</h3>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">$&gt; git submodule init\n$&gt; git submodule update\n$&gt; brew install buck</code></pre>\n      </div>\n<h3>Build and Test</h3>\n<div class="gatsby-highlight" data-language="text">\n      <pre class="language-text"><code class="language-text">$&gt; buck build //:yoga\n$&gt; buck test //:yoga</code></pre>\n      </div>\n<h2>Making a Change</h2>\n<p>Now all you need to do is make your change and test it before submitting a pull request for review.\nBelow is the general structure of the repo and where you may want to make your change. One you have\nmade your change see the <a href="/contributing/testing">testing documentation</a> for more on how to test your change.</p>\n<div class="gatsby-highlight" data-language="bash">\n      <pre class="language-bash"><code class="language-bash">/yoga\n<span class="token operator">|</span>-- yoga                  <span class="token comment"># Home to the main Yoga codebase written in C++. Any algorithmic changes should be made here</span>\n<span class="token operator">|</span>-- lib                   <span class="token comment"># Yoga external dependencies. Be thoughtful adding any new ones</span>\n<span class="token operator">|</span>-- tests                 <span class="token comment"># Yoga\'s C++ test suite. Both manaul and generated tests</span>\n<span class="token operator">|</span>-- gentest\n<span class="token operator">|</span>   <span class="token operator">|</span>-- fixtures          <span class="token comment"># html fixtures for generated tests</span>\n<span class="token operator">|</span>-- <span class="token function">java</span>\n<span class="token operator">|</span>   <span class="token operator">|</span>-- com/facebook/yoga <span class="token comment"># Java binding code</span>\n<span class="token operator">|</span>   <span class="token operator">|</span>-- jni               <span class="token comment"># JNI binding code</span>\n<span class="token operator">|</span>-- javascript            <span class="token comment"># emscripten / javascript bindings</span></code></pre>\n      </div>'}}}});
